parts.text:
[
  {
    "id": "app_title_bar",
    "type": "title_bar",
    "text": "Sem título 1 - LibreOffice Writer",
    "region": "top-bar",
    "meta": {
      "application_name": "LibreOffice Writer",
      "document_name": "Sem título 1"
    }
  },
  {
    "id": "app_menu_bar",
    "type": "menu_bar",
    "region": "top-bar",
    "items": [
      {"id": "menu_arquivo", "text": "Arquivo", "actions": ["onClick"]},
      {"id": "menu_editar", "text": "Editar", "actions": ["onClick"]},
      {"id": "menu_exibir", "text": "Exibir", "actions": ["onClick"]},
      {"id": "menu_inserir", "text": "Inserir", "actions": ["onClick"]},
      {"id": "menu_formatar", "text": "Formatar", "actions": ["onClick"]},
      {"id": "menu_estilos", "text": "Estilos", "actions": ["onClick"]},
      {"id": "menu_tabela", "text": "Tabela", "actions": ["onClick"]},
      {"id": "menu_formulario", "text": "Formulário", "actions": ["onClick"]},
      {"id": "menu_ferramentas", "text": "Ferramentas", "actions": ["onClick"]},
      {"id": "menu_janela", "text": "Janela", "actions": ["onClick"]},
      {"id": "menu_ajuda", "text": "Ajuda", "actions": ["onClick"]}
    ]
  },
  {
    "id": "app_toolbar_main",
    "type": "toolbar",
    "region": "top-bar",
    "items": [
      {"id": "toolbar_icon_new", "type": "icon_button", "icon": "new_document", "actions": ["onClick"]},
      {"id": "toolbar_icon_open", "type": "icon_button", "icon": "open_document", "actions": ["onClick"]},
      {"id": "toolbar_icon_save", "type": "icon_button", "icon": "save_document", "actions": ["onClick"]},
      {"id": "toolbar_icon_print", "type": "icon_button", "icon": "print", "actions": ["onClick"]},
      {"id": "toolbar_icon_print_preview", "type": "icon_button", "icon": "print_preview", "actions": ["onClick"]},
      {"id": "toolbar_icon_cut", "type": "icon_button", "icon": "cut", "actions": ["onClick"]},
      {"id": "toolbar_icon_copy", "type": "icon_button", "icon": "copy", "actions": ["onClick"]},
      {"id": "toolbar_icon_paste", "type": "icon_button", "icon": "paste", "actions": ["onClick"]},
      {"id": "toolbar_icon_undo", "type": "icon_button", "icon": "undo", "actions": ["onClick"]},
      {"id": "toolbar_icon_redo", "type": "icon_button", "icon": "redo", "actions": ["onClick"]}
      ,
      {"id": "dropdown_paragraph_style", "type": "dropdown", "text": "Estilo de parágrafo Padrão", "actions": ["onChange"]},
      {"id": "dropdown_font_family", "type": "dropdown", "text": "Arial", "actions": ["onChange"]},
      {"id": "dropdown_font_size", "type": "dropdown", "text": "12 pt", "actions": ["onChange"]},
      {"id": "toolbar_icon_bold", "type": "icon_button", "icon": "bold", "actions": ["onClick"]},
      {"id": "toolbar_icon_italic", "type": "icon_button", "icon": "italic", "actions": ["onClick"]},
      {"id": "toolbar_icon_underline", "type": "icon_button", "icon": "underline", "actions": ["onClick"]}
    ]
  },
  {
    "id": "app_status_bar",
    "type": "status_bar",
    "region": "bottom-bar",
    "items": [
      {"id": "status_page_info", "type": "text", "text": "Página 1 de 1"},
      {"id": "status_word_count", "type": "text", "text": "0 palavra"},
      {"id": "status_char_count", "type": "text", "text": "0 caractere"},
      {"id": "status_page_style", "type": "text", "text": "Estilo de página Padrão"},
      {"id": "status_language", "type": "text", "text": "Português (Brasil)"},
      {"id": "status_zoom_slider", "type": "slider", "text": "Zoom", "value": "100%"},
      {"id": "status_view_mode_single", "type": "icon_button", "icon": "single_page_view", "actions": ["onClick"]},
      {"id": "status_view_mode_multiple", "type": "icon_button", "icon": "multiple_page_view", "actions": ["onClick"]}
    ]
  },
  {
    "id": "modal_insert_table",
    "type": "modal",
    "text": "Inserir tabela",
    "region": "main-content",
    "state": "active",
    "components": [
      {
        "id": "modal_title",
        "type": "text",
        "text": "Inserir tabela",
        "region": "modal-header"
      },
      {
        "id": "modal_close_button",
        "type": "icon_button",
        "icon": "close",
        "region": "modal-header",
        "actions": ["onClick"]
      },
      {
        "id": "section_geral",
        "type": "section",
        "text": "Geral",
        "components": [
          {
            "id": "label_nome",
            "type": "label",
            "text": "Nome:"
          },
          {
            "id": "input_nome_tabela",
            "type": "input",
            "text": "Tabela1",
            "state": "enabled",
            "actions": ["onChange"]
          },
          {
            "id": "label_colunas",
            "type": "label",
            "text": "Colunas:"
          },
          {
            "id": "input_colunas",
            "type": "number_input",
            "text": "4",
            "state": "enabled",
            "actions": ["onChange", "onIncrement", "onDecrement"]
          },
          {
            "id": "label_linhas",
            "type": "label",
            "text": "Linhas:"
          },
          {
            "id": "input_linhas",
            "type": "number_input",
            "text": "4",
            "state": "focused",
            "actions": ["onChange", "onIncrement", "onDecrement"]
          }
        ]
      },
      {
        "id": "section_opcoes",
        "type": "section",
        "text": "Opções",
        "components": [
          {
            "id": "checkbox_titulo",
            "type": "checkbox",
            "text": "Título",
            "state": "unchecked",
            "actions": ["onClick"]
          },
          {
            "id": "checkbox_repetir_linhas_titulo",
            "type": "checkbox",
            "text": "Repetir linhas de título nas novas páginas",
            "state": "checked",
            "actions": ["onClick"]
          },
          {
            "id": "label_linhas_de_titulo",
            "type": "label",
            "text": "Linhas de título:",
            "state": "disabled"
          },
          {
            "id": "input_linhas_de_titulo",
            "type": "number_input",
            "text": "1",
            "state": "disabled",
            "actions": ["onChange", "onIncrement", "onDecrement"]
          },
          {
            "id": "checkbox_nao_dividir_tabela",
            "type": "checkbox",
            "text": "Não dividir tabela entre páginas",
            "state": "unchecked",
            "actions": ["onClick"]
          }
        ]
      },
      {
        "id": "section_estilos",
        "type": "section",
        "text": "Estilos",
        "components": [
          {
            "id": "listbox_estilos",
            "type": "listbox",
            "items": [
              {"id": "style_nenhum", "text": "Nenhum", "state": "selected", "actions": ["onClick"]},
              {"id": "style_padrao", "text": "Estilo de tabela Padrão", "state": "enabled", "actions": ["onClick"]},
              {"id": "style_academico", "text": "Acadêmico", "state": "enabled", "actions": ["onClick"]},
              {"id": "style_mundo_azul", "text": "Mundo azul", "state": "enabled", "actions": ["onClick"]},
              {"id": "style_mundo_verde", "text": "Mundo verde", "state": "enabled", "actions": ["onClick"]},
              {"id": "style_mundo_escarlate", "text": "Mundo escarlate", "state": "enabled", "actions": ["onClick"]},
              {"id": "style_mundo_alvorada", "text": "Mundo da alvorada", "state": "enabled", "actions": ["onClick"]},
              {"id": "style_elegante", "text": "Elegante", "state": "enabled", "actions": ["onClick"]}
            ],
            "actions": ["onScroll", "onSelect"]
          },
          {
            "id": "table_preview",
            "type": "table",
            "text": "Pré-visualização do estilo de tabela",
            "meta": {
              "headers": ["", "Jan", "Fev", "Mar", "Soma"],
              "rows": [
                ["Norte", "6", "7", "8", "21"],
                ["Meio", "11", "12", "13", "36"],
                ["Sul", "16", "17", "18", "51"],
                ["Soma", "33", "36", "39", "108"]
              ]
            }
          }
        ]
      },
      {
        "id": "button_ajuda",
        "type": "button",
        "text": "Ajuda",
        "state": "enabled",
        "actions": ["onClick"]
      },
      {
        "id": "button_inserir",
        "type": "button",
        "text": "Inserir",
        "state": "enabled",
        "actions": ["onClick"],
        "meta": {"is_primary": true}
      },
      {
        "id": "button_cancelar",
        "type": "button",
        "text": "Cancelar",
        "state": "enabled",
        "actions": ["onClick"]
      }
    ]
  }
]
